import React from 'react';




const App6=()=>{

    return (
        <>
        <h1>my name is </h1>
        <select>
            <option>1</option>
            <option>2</option>
            <option>3</option>
            <option>4</option>
        </select>
       
    </>
    );

};
export default App6;
